        <div class="sql-modal_content">
          <h2 class="sql-modal_title">SQL</h2>
          <p class="sql-modal_description">SQL (язык структурированных запросов) — это стандартный язык для взаимодействия с реляционными базами данных. Он позволяет создавать, изменять и запрашивать базы данных для эффективного управления данными. SQL используется для организации информации, выполнения сложных запросов и обеспечения целостности данных в системах управления базами данных, таких как MySQL, PostgreSQL или Microsoft SQL Server.</p>
          <hr />
          <p>Хороший уровень владения SQL, с навыками работы как с базовыми, так и с продвинутыми запросами, включая сложные объединения, подзапросы, агрегации и транзакции. Солидный опыт работы с реляционными базами данных (MySQL, PostgreSQL) для управления крупными системами данных и оптимизации производительности. Глубокие знания в управлении индексами, нормализации баз данных и обработке транзакций.</p>
          <hr />
          <ul class="sql-modal_list">
            <li><strong>Проектирование баз данных:</strong> Создание и оптимизация реляционных баз данных с особым вниманием к нормализации таблиц, управлению первичными и внешними ключами и моделированию отношений между данными.</li>
            <li><strong>Сложные запросы:</strong> Владение внутренними объединениями (INNER JOIN), внешними объединениями (LEFT JOIN, RIGHT JOIN), кросс-объединениями (CROSS JOIN) и самосоединениями для извлечения сложных данных из нескольких таблиц.</li>
            <li><strong>Агрегация и фильтрация:</strong> Использование агрегатных функций (COUNT, SUM, AVG, MAX, MIN) и расширенных условий фильтрации (WHERE, HAVING) для обработки и анализа данных на основе конкретных критериев.</li>
            <li><strong>Подзапросы и CTE (обобщенные табличные выражения):</strong> Создание подзапросов и использование CTE для упрощения сложных запросов, улучшения их читаемости и повторного использования.</li>
            <li><strong>Безопасность базы данных:</strong> Внедрение мер безопасности, таких как управление правами доступа, использование представлений для сокрытия определенной информации и предотвращение SQL-инъекций.</li>
          </ul>
          <hr />
          <h4>Цели для улучшения:</h4>
          <p>Углубление знаний в области оптимизации баз данных и использование хранимых процедур и триггеров для автоматизации определенных действий на уровне базы данных. Изучение нереляционных баз данных, таких как MongoDB, для лучшего понимания альтернатив SQL. Продолжение изучения современных функций баз данных, таких как геопространственные индексы и аналитические запросы.</p>
          <button class="sql-modal_close">Закрыть</button>
        </div>
